import React, { Component } from "react";
import "./sidebar.css";

class Sidebar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="sidebar">
        <div
          onClick={() => this.props.handleNavigation(1)}
          className="sidebar-detail"
        >
          Bank
        </div>

      </div>
    );
  }
}
export default Sidebar;
